import React, { Component } from "react";
import "../styles/Home.css";

class Home extends Component {
  render() {
    return (
      <div className="grid-container">
        <div className="item-1">header</div>
        <div className="item-2">menu</div>
        <div className="item-3">
          <h1>Hello World!</h1>
        </div>
        <div className="item-5">footer</div>
      </div>
    );
  }
}

export default Home;
